// fullscreen.js
var app = require('vigour-js/app')
var statusBar = app.cases.$isNative && require('vigour-native-statusBar')

module.exports = function() {
  var player = this
  var holder = player.parent
  var topbar = holder.checkParent('topbar',true)
  var switcherHolder = holder.checkParent('switcher', true)
  if(player.isFullscreen) {
    if(statusBar) {
      statusBar.set({
        style:'light',
        visibility:'overlay'
      }, function (err) {
        if (err) alert("error setting statusBar: " +err)
      })
    }
    player.set(player.revertFullscreen)
    switcherHolder.node.style.height = null
    holder.set({
      page: {
        display:'block'
      },
      swipeup: {
        display:{transform:null}
      }
    })
    topbar.display = 'table'
    player.isFullscreen = null
    app.switcher._swElem.holder.miniplayer.display = { transform: null }
  } else {
    if(statusBar) {
      statusBar.set({
        visibility:'hidden'
      }, function (err) {
        if (err) alert("error setting statusBar: " +err)
      })
    }
    player.revertFullscreen = player.revertFullscreen 
      || ({
        w:'100%',
        h:player.h.val,
        rotate:0,
        x:{val:0,translate:true}
      }) 
    player.set({
      rotate:90,
      w:app.h,
      h:app.w,
      x:{ val: app.w, translate: true},
    })
    switcherHolder.node.style.height = app.h.val + 'px'

    holder.set({
      page: {
        display:'none'
      },
      swipeup: {
        display:{transform:'none'}
      }
    })
    topbar.display = 'none'
    player.isFullscreen = true
    app.switcher._swElem.holder.miniplayer.display = { transform: 'none' }
  }
}

